import React, { Component } from "react";
import EventsCell from "../Event/EventsCell";
import { Table } from 'reactstrap';
import axios from "axios";
import EventsTableInfo from "./EventsTableInfo";

const apiUrl = 'http://cist.nure.ua/ias/app/tt/P_API_EVENT_JSON?timetable_id=5259356';
const MAX_EVENTS_COUNT = 6;
const MS_IN_SEC = 1000;
const MS_IN_DAY = 24 * 3600 * 1000;
const SCROLL_HEIGHT = 120;

class EventsTable extends Component {
    constructor(props) {
        super(props);

        this.state = {
            timetable: null
        }
    }

    componentDidMount() {
        this.fillTimetableData();
    }

    fillTimetableData() {
        axios.get(apiUrl)
        .then(response => {
            this.setState({timetable: response.data});
          }).catch(e => {
              this.setState({timetable: JSON.parse(data)});
            }) 
          .then(() => {
              // scrolling to the current date after a little pause 
              // (when timetable is updated)
              setTimeout(() => {
                let scroll = this.getTableHeaders(this.state.timetable).map(h => h.toDateString()).indexOf(new Date().toDateString());
                document.getElementById('timetable-block').scrollLeft = SCROLL_HEIGHT * scroll;
              }, 100);
          });
    }

    getTableHeaders(timetable) {
        let tableHeaders = [];
        
        if (timetable) {
            const events = this.state.timetable.events;
            const startDate = new Date(events[0].start_time * MS_IN_SEC);
            const endDate = new Date(events[events.length - 1].start_time * MS_IN_SEC);
            let date = new Date(startDate);
            
            while(date.getTime() <= endDate.getTime()) {
                tableHeaders.push(new Date(date));
                date.setTime(date.getTime() + MS_IN_DAY);
            }
        }

        return tableHeaders;
    }

    convertEvents(timetable) {
        let result = [];

        if (timetable) {
            timetable.events.forEach((e, i) => {
                result.push({
                    id: i,
                    date: new Date(e.start_time * MS_IN_SEC),
                    subject: timetable.subjects.filter(s => s.id === e.subject_id)[0],
                    teacher: timetable.teachers.filter(t => t.id === e.teachers[0])[0],
                    type: timetable.types.filter(t => t.id === e.type)[0],
                    groups: e.groups.map(g => timetable.groups.filter(gr => gr.id === g)[0]),
                    number: e.number_pair,
                    auditory: e.auditory
                });
            });
        }

        return result;
    }

    getTableRows(timetable) {
        let tableHeaders = this.getTableHeaders(timetable);
        let table = [];
        let events = this.convertEvents(timetable);
     

        for (let i = 0; i < MAX_EVENTS_COUNT; i++) {
            table.push(events.filter(e => e.number === i+1));
        }

        let result = table.map((e, i) => {
            let tr = tableHeaders.map((h, id) => {
                let dateEvents = e.filter(ee => ee.date.toDateString() === h.toDateString());
                let className = h.getTime() < new Date().getTime() ? 'lastpair-td' : '';

                return (<td key={id} className={className}> 
                        <EventsCell 
                            events={dateEvents}
                        />
                </td>);
            });

            return <tr key={i} className='timetable-tr'>{tr}</tr>;
        });

        return result;
    }

    render() {
        const tableRows = this.getTableRows(this.state.timetable);
        const info = this.state.timetable ? <EventsTableInfo /> : '';
        const tableHeaders = this.getTimetableDates(this.state.timetable)
            .map(h => <th key={h.getTime()}>{h.toLocaleDateString()}</th>);

        return (
            <div className="EventsTable">
                {info}
                <div 
                    id='timetable-block'
                >
                    <Table bordered className='timetable'>
                        <thead>
                            <tr>
                                {tableHeaders}
                            </tr>
                        </thead>
                        <tbody>
                        {tableRows}
                        </tbody>
                    </Table>
                </div>
                <div id="overlay" className='modal_hidden'></div>
            </div>
        );
    }
}

export default EventsTable;

